import React from 'react';
import AuthPage from './pages/auth_form';

const App = () => {
  return (
    <div>
      <h1>Welcome to AllGoodsHub</h1>
      <Switch>
  <Route exact path="/auth_form" component={AuthPage} />
</Switch>
    </div>
    
  );
};


export default App;
